import { useEffect } from "react";
import { useState } from "react";

const Fetching = () => {
    var [actor, setActor] = useState('')
    useEffect(()=>{
        const apiUrl1 = 'http://webswitch.ir:3000/actors'
        fetch (apiUrl1)
        .then ((response)=> response.json())
        .then  ((data1) => setActor(data1))


        const apiUrl2 = 'http://webswitch.ir:3000/sensors'
        fetch (apiUrl2)
        .then ((response)=> response.json())
        .then  ((data2) => console.log ('This is the second part of the api', data2))
    })
    return ( 
        <h1>{actor}</h1>
     );
}

export default Fetching;
